import { DateRangePicker } from 'rsuite';
const instance = (
  <div>
    <DateRangePicker
      appearance="default"
      placeholder="Default"
      style={{ width: 280 }}
    />
    <hr />
    <DateRangePicker
      appearance="subtle"
      placeholder="Subtle"
      style={{ width: 280 }}
    />
  </div>
);
ReactDOM.render(instance);
